import { CSSProperties, Fragment, FunctionComponent } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Zoom, Pagination } from "swiper";

import PageHeader from "../Components/Atoms/PageHeader";

import Menu1 from "../Assets/Images/menu-1.png";
import Menu2 from "../Assets/Images/menu-2.png";
import Menu3 from "../Assets/Images/menu-3.png";
import Menu4 from "../Assets/Images/menu-4.png";


const Menu: FunctionComponent = () => {
    return (
        <Fragment>
            <PageHeader title='Menu' />
            <div className="page-container">
                <Swiper
                    style={{
                        "--swiper-navigation-color": "#fff",
                        "--swiper-pagination-color": "#fff",
                    } as CSSProperties}
                    zoom={true}
                    pagination={{
                        clickable: true,
                    }}
                    spaceBetween={ 10 }
                    modules={[Zoom, Pagination]}
                    className="menu-swiper"
                >
                    <SwiperSlide>
                        <div className="swiper-zoom-container">
                            <img src={ Menu1 } alt="Yang's Sushi & Wok menu pagina 1" width={ 1751 } height={ 2480 } />
                        </div>
                    </SwiperSlide>
                    <SwiperSlide>
                        <div className="swiper-zoom-container">
                            <img src={ Menu2 } alt="Yang's Sushi & Wok menu pagina 2" />
                        </div>
                    </SwiperSlide>
                    <SwiperSlide>
                        <div className="swiper-zoom-container">
                            <img src={ Menu3 } alt="Yang's Sushi & Wok menu pagina 3" />
                        </div>
                    </SwiperSlide>
                    <SwiperSlide>
                        <div className="swiper-zoom-container">
                            <img src={ Menu4 } alt="Yang's Sushi & Wok menu pagina 4" />
                        </div>
                    </SwiperSlide>
                </Swiper>
            </div>
        </Fragment>
    );
}

export default Menu;
